function addNumbers(num1, num2) {
	return num1 + num2;
};

export function multiplyNumbers(num1, num2) {
	return num1 * num2;
};

export function subtractNumbers(num1, num2) {
	return num1 - num2;
};

console.log(addNumbers(1, 2)); // 3


export default addNumbers;
